import React, { Component } from 'react';
import Router from 'next/router';
import Link from 'next/link';
import Image from './Image';

class Movie extends Component {
    prefetchMoviePage = () => {
        Router.prefetch(`/movie?id=${this.props.id}`)
    }

    render() {
        const { movie } = this.props;
        console.log('Inside Movie');
        console.log(movie);
        return (
            <Link as={`/movie/${movie.id}`} href={`/movie?id=${movie.id}`}>
                <div className="card" id={`movie-${id}`} onMouseEnter={this.prefetchMoviePage}>
                    <div className="card-image">
                        <Image src={movie.images[0].url} alt={`Poster for title`} className="img-responsive"/>
                    </div>
                    <div className="card-header">
                        <div className="card-title h5 text-primary text-ellipsis">
                            {movie.title}
                        </div>
                        <div className="card-body text-ellipsis">Overview</div>
                    </div>
                </div>
            </Link>
        );
    }
}

export default Movie;
